import React from 'react';


const App = () => {
    return ( <div className = "container mt-5">
            <button className = "btn btn-primary" >
                +
            </button>
            <span>
                0
            </span>
            <button className = "btn btn-primary" >
                -
            </button>
         </div>
    );
}

export default App;
